"use strict";Vue.component("ht-upload-exl",{props:["upload_config","uploadData"],data:function(){return{myData:[],file:null,loadingStatus:!1,uploadType:"cover",uploadLog:""}},methods:{handleUpload:function(t){return console.log(this.uploadData),this.file=t,console.log(t,"handleUpload file"),!1},uploadSuccess:function(t,o,n){this.$Message.info(t.msg),console.log(t,o,n,"uploadSuccess :response, file, fileList"),this.closeM()},uploadError:function(t,o,n){this.$Message.error(t.msg),console.log(t,o,n,"uploadError :error, file, fileList")},upload:function(){this.loadingStatus=!0,this.$refs.uploadRef.post(this.file),this.loadingStatus=!1},closeM:function(){this.$emit("close-modal",!1)}},watch:{},mounted:function(){this.myData=this.upload_config},template:'<div>\n\t\t\t\t\t<ul style="margin: 15px 0px;">\n\t\t\t\t\t\t<li>1. 引入文件只支持Excel格式(*.xls).</li>\n\t\t\t\t\t\t<li>2. 引入文件的格式必须和引出的格式相同.</li>\n\t\t\t\t\t\t<li>3. 请确定所选定的文件不在任何用户操作当中.</li>\n\t\t\t\t\t</ul>\n\t\t\t\t\t<template>\n\t\t\t\t\t\t<Upload \n\t\t\t\t\t\t    ref="uploadRef"\n\t\t\t\t\t\t\t:before-upload="handleUpload" \n\t\t\t\t\t\t\t:on-success="uploadSuccess"\n\t\t\t\t\t\t\t:on-error="uploadError"\n\t\t\t\t\t\t\t:data="uploadData"\n\t\t\t\t\t\t\t:action="upload_config.url"\n\t\t\t\t\t\t>\n\t\t\t\t\t\t\t<i-button type="ghost" icon="ios-cloud-upload-outline">Upload files</i-button>\n\t\t\t\t\t\t</Upload>\n\t\t\t\t\t\t<div v-if="file !== null">Upload file: {{ file.name }} </div>\n\t\t\t\t\t</template>\n\n\t\t\t\t\t<RadioGroup v-model="uploadType" style="margin: 15px 0px;">\n\t\t\t\t\t\t<Radio label="cover">\n\t\t\t\t\t\t\t<span>覆盖模式</span>\n\t\t\t\t\t\t</Radio>\n\t\t\t\t\t\t\x3c!--<Radio label="append">\n\t\t\t\t\t\t\t<span>追加模式</span>\n\t\t\t\t\t\t</Radio>--\x3e\n\t\t\t\t\t</RadioGroup>\n\t\t\t\t\t\n\t\t\t\t\t\x3c!-- \n\t\t\t\t\t\t<div style="margin: 15px 0px;">\n\t\t\t\t\t\t\t<p>引入日志</p>\n\t\t\t\t\t\t\t<i-input v-model="uploadLog" type="textarea" :rows="4" placeholder=""></i-input>\n\t\t\t\t\t\t</div>  \n\t\t\t\t\t--\x3e\n\t\t\t\t\t<div style="margin: 15px 0px;text-align: right;text-align: -webkit-right;">\n\t\t\t\t\t\t<i-button  @click="upload" :loading="loadingStatus">{{ loadingStatus ? \'Uploading\' : \'引入\' }}</i-button>\n\t\t\t\t\t\t<i-button  @click="closeM" >退出</i-button>\n\t\t\t\t\t</div>\n\t\t\t\t\t\n\t\t\t\t</div>'});